import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Navbar } from './components/Navbar';
import { Intro } from './components/Intro';
import { Text } from './components/Text';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          < Navbar />
          < Intro />
          {/* <Text /> */}
        </Route>
      </Switch>

    </Router>

  );
}

export default App;
